def prime_fib(n: int) -> int:
    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def fibonacci(n):
        a, b = 0, 1
        while a < n:
            yield a
            a, b = b, a + b

    count = 0
    for fib_num in fibonacci(1000000):
        if is_prime(fib_num):
            count += 1
            if count == n:
                return fib_num

