        if char.isalpha():
            if char.islower():
                if char in vowels:
                    encoded += chr((ord(char) - ord('a') + 2) % 26 + ord('a'))
                else:
                    encoded += chr((ord(char) - ord('a') + 1) % 26 + ord('a'))
