def minPath(grid, k):
    if not grid or k < 1:
        return []
    rows, cols = len(grid), len(grid[0])
    visited = set()
    queue = [(0, 0, 0, [grid[0][0]])]
    while queue:
        x, y, steps, path = queue.pop(0)
        if steps == k:
            return path
        if (x, y, steps) in visited:
            continue
        visited.add((x, y, steps))
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < rows and 0 <= ny < cols:
                queue.append((nx, ny, steps + 1, path + [grid[nx][ny]]))
    return []

