def do_algebra(operator: List[str], operand: List[int]) -> int:
    result = operand[0]
    for i in range(len(operator)):
        if operator[i] == '+':
            result += operand[i + 1]
        elif operator[i] == '-':
            result -= operand[i + 1]
        elif operator[i] == '*':
            result *= operand[i + 1]
        elif operator[i] == '//':
            result //= operand[i + 1]
        elif operator[i] == '**':
            result **= operand[i + 1]
    return result

def solve(s):
    if not any(char.isalpha() for char in s):
        return s[::-1]
    return ''.join(char.swapcase() if char.isalpha() else char for char in s)

